import React from "react";
import { Link, Typography } from "@mui/material";
function MainFooter() {
  return (
    <Typography 
    variant="body2" 
    
    align="center" 
    sx={{
      m:3,
      color:"#fff",
      backgroundColor:"secondary.darker"}}
    >
      {"Copyright @ "}
      <Link color="#fff" href="">
        DinhNgocLienNhi {""}
      </Link>
      {new Date().getFullYear()}
      {"."}
    </Typography>
  );
}

export default MainFooter;
